contracts/LiquidityManager.sol.content:
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./interfaces/IJoeRouter02.sol";

contract LiquidityManager is Ownable {
    IJoeRouter02 public router;
    address public audb;
    address public collateral; // e.g., USDC or WAVAX

    constructor(address _router, address _audb, address _collateral) Ownable() {
        router = IJoeRouter02(_router);
        audb = _audb;
        collateral = _collateral;
    }

    function addLiquidity(
        uint256 audbAmount,
        uint256 collateralAmount
    ) external onlyOwner {
        IERC20(audb).transferFrom(msg.sender, address(this), audbAmount);
        IERC20(collateral).transferFrom(
            msg.sender,
            address(this),
            collateralAmount
        );

        IERC20(audb).approve(address(router), audbAmount);
        IERC20(collateral).approve(address(router), collateralAmount);

        router.addLiquidity(
            audb,
            collateral,
            audbAmount,
            collateralAmount,
            0, // Slippage unchecked for demo
            0,
            address(this), // POL: Contract holds LP tokens
            block.timestamp + 300
        );
    }

    // Function to withdraw LP tokens or rewards
    function withdraw(address token, uint256 amount) external onlyOwner {
        IERC20(token).transfer(msg.sender, amount);
    }
}

