contracts/Rebalancer.sol.content:
pragma solidity ^0.8.20;

import "@pythnetwork/pyth-sdk-solidity/IPyth.sol";
import "@pythnetwork/pyth-sdk-solidity/PythStructs.sol";
import "./AUDB.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Rebalancer is Ownable, ReentrancyGuard {
    IPyth public pyth;
    AUDB public audb;
    bytes32 public audUsdPriceId; // Pyth price ID for AUD/USD
    uint256 public peg = 1e18; // 1 AUD in wei-scale
    uint256 public deviationThreshold = 0.01e18; // 1% deviation

    event Rebalanced(uint256 currentPrice, uint256 adjustment, bool isMint);

    constructor(
        address _pyth,
        bytes32 _audUsdPriceId,
        address _audb
    ) Ownable() {
        pyth = IPyth(_pyth); // Fuji: 0x23f0e8FAeE7bbb405E7A7C3d60138FCfd43d7509
        audUsdPriceId = _audUsdPriceId;
        audb = AUDB(_audb);
    }

    function getMarketPrice() public view returns (uint256) {
        // In a real implementation, we would check the Pyth price AND the DEX price.
        // For this bootstrapper, we rely on Pyth to determine the 'true' value deviation.
        PythStructs.Price memory price = pyth.getPriceUnsafe(audUsdPriceId);

        // Pyth returns price with an exponent. We need to normalize to 1e18.
        // Price = price.price * 10^price.expo
        // Example: 0.65 AUD/USD -> price: 65000000, expo: -8

        uint256 ethPrice18Decimals = convertToUint(price, 18);
        return ethPrice18Decimals;
    }

    function convertToUint(
        PythStructs.Price memory price,
        uint8 targetDecimals
    ) private pure returns (uint256) {
        if (price.price < 0 || price.expo > 0 || price.expo < -255) {
            revert("Invalid price");
        }

        uint8 priceDecimals = uint8(uint32(-1 * price.expo));

        if (targetDecimals >= priceDecimals) {
            return
                uint256(int256(price.price)) *
                (10 ** uint256(targetDecimals - priceDecimals));
        } else {
            return
                uint256(int256(price.price)) /
                (10 ** uint256(priceDecimals - targetDecimals));
        }
    }

    function rebalance() external onlyOwner nonReentrant {
        uint256 currentPrice = getMarketPrice();
        uint256 supply = audb.totalSupply();

        if (currentPrice > peg + deviationThreshold) {
            // Price is too high (e.g. 1.02), supply is too low -> MINT
            // Detailed calculus would go here. Simplified:
            uint256 delta = currentPrice - peg;
            uint256 amountToMint = (delta * supply) / peg;

            audb.mint(address(this), amountToMint);
            // NOTE: In production, we woud send to LiquidityManager, not hold here.

            emit Rebalanced(currentPrice, amountToMint, true);
        } else if (currentPrice < peg - deviationThreshold) {
            // Price is too low (e.g. 0.98), supply is too high -> BURN
            uint256 delta = peg - currentPrice;
            uint256 amountToBurn = (delta * supply) / peg;

            // We can only burn what we hold. In full version, we'd pull from LiquidityManager.
            uint256 balance = audb.balanceOf(address(this));
            if (balance < amountToBurn) {
                amountToBurn = balance;
            }

            if (amountToBurn > 0) {
                audb.burn(address(this), amountToBurn);
                emit Rebalanced(currentPrice, amountToBurn, false);
            }
        }
    }
}

